import React,{useEffect,useState} from "react"; 
import Pagination from "@material-ui/core/TablePagination"

const Page = () => {
    const [post,setPost] = useState([])
    useEffect(()=>{
        fetch('https://jsonplaceholder.typicode.com/posts/')
        .then(response => response.json())
        .then(json => setPost(json))
        
    },[])
    console.log(post)
    return(
        <div style={{display:"grid",gridTemplateColumns:'repeat(auto-fit, minmax(400px, 1fr))', 
        gridAutoFlow:'row', gap:'2rem', justifyItems:'center'
        ,padding:'2rem',
        width:'95%'
        }}>
            {post.map(ele =>(
                <div style={{padding:'3rem'}}>
                <h4 >{ele.title}</h4>
                <p >{ele.body}</p>
                </div>
            ))}
            <Pagination count={post.length} />

        </div>
    )
}

export default Page;
